import React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import { Button, Grid, Stack } from "@mui/material";

export default function NavBar() {
  return (
    <div>
      <Box>
        <AppBar
          sx={{
            background: "#172332",
            boxShadow: "none",
            padding: "1em 2em",
            color: "#FFFFFF",
          }}
        >
          <Toolbar>
            <Grid
              container
              direction={"row"}
              coulmnSpacing={{ xs: 1, sm: 2, md: 3 }}
            >
              <Grid item>
                {/* <img src={fahari} width="150em" alt="fahari-logo" /> */}
              </Grid>
              <Grid item xs={4}>
                <Typography variant="h5" component="div" className="main_title">
                  Find-A-Crop
                </Typography>
              </Grid>
              <Grid item xs={2}
              sx={{
                  display: "flex",
                  justifyContent: "center"
              }}>
                <Typography variant="h5" component="div" className="main_title">
                  Name-A-Crop
                </Typography>
              </Grid>
              <Grid item xs={6}>
                <Stack
                  direction="row"
                  spacing={7}
                  sx={{
                    // paddingLeft: "630px",
                    display: "flex",
                    justifyContent:"flex-end"
                  }}
                >
                  <Button>About Us</Button>

                  <Button>Contact</Button>
                </Stack>
              </Grid>
            </Grid>
          </Toolbar>
        </AppBar>
      </Box>
    </div>
  );
}
